B.pU=new A.bu([B.rP,"Bem-vindo ao meu site! Fiz ele para me apresentar, ent\xe3o achei que seria legal fazer isso mostrando os c\xf4modos de onde moro. Para continuar a conversa, clique neste bal\xe3o de mensagem.",B.rV,".... Eu n\xe3o moro aqui de verdade \ud83d\ude05. S\xe3o imagens que peguei na internet. Elas usam a licen\xe7a CC0 e n\xe3o tem direito autoral. S\xe3o meramente ilustrativas.",B.rW,"Essa \xe9 a porta de entrada... Para entrar, experimente clicar na ma\xe7aneta (S\xf3 funciona depois de clicar neste bal\xe3o e acabar a conversa). Voc\xea tamb\xe9m pode me perguntar alguma das op\xe7\xf5es do canto inferior esquerdo da tela.",B.rX,"Olha! Parece que tinha uma chave escondida aqui! Aposto que agora podemos abrir a porta!",B.rZ,"A porta est\xe1 trancada. Acho que j\xe1 era de se esperar, n\xe9? Ou voc\xea por um acaso sai por a\xed deixando sua porta aberta? Por\xe9m eu n\xe3o consigo achar a chave em nenhum lugar...",B.t_,"Agora sim! Com a chave podemos entrar. Venha... vou te mostrar os aposentos.",B.rY,"A gente j\xe1 conseguiu a chave. Agora sim podemos clicar na ma\xe7aneta para entrar.",B.t0,"Lar doce lar! Daqui podemos subir as escadas, onde temos os quartos e o banheiro. Ou, podemos ficar no primeiro andar mesmo e conhecer a sala e a cozinha. Tamb\xe9m podemos voltar e sair, se quiser.",B.t1,"Vamos subindo, cuidado para n\xe3o trope\xe7ar.",B.rQ,"Sei que est\xe1 de dia, mas n\xe3o \xe9 seguro subir com as luzes apagadas.",B.rR,"Ent\xe3o vamos conhecer o resto do primeiro andar...",B.jj,"S\xe3o",B.rS,"Eu acho, n\xe9. Se o rel\xf3gio do seu dispositivo estiver errado, posso ter me enganado. Por\xe9m, n\xe3o faz diferen\xe7a. A foto daqui s\xf3 foi tirada de dia mesmo.",B.rT,"\xd3timo, com as luzes acesas, podemos subir as escadas.",B.rU,"Voc\xea apagou as luzes de novo."],A.R("bu<cI,q>"))
